import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './My Components/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/checkout" >
            <Navbar />
          </Route>
          <Route path="/login" />
          <Route path="/">
            <Navbar />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
